// src/HomePage.js
import { useNavigate } from 'react-router-dom';

export default function HomePage() {
  const navigate = useNavigate();

  return (
    <main className="min-h-screen bg-gray-900 text-white flex flex-col items-center justify-center px-4 py-16">
      <div className="flex items-center gap-4 mb-8">
        <img src="/logo.png.jpg" alt="logo" className="h-20 w-20 rounded-2xl shadow-lg" />
        <h1 className="text-4xl md:text-5xl font-bold tracking-tight">Safeswap</h1>
      </div>

      <p className="text-gray-300 mb-12 text-lg text-center max-w-md">
        Escolha uma das opções abaixo para começar:
      </p>

      <div className="flex flex-col md:flex-row gap-6">
        <button
          onClick={() => alert("Funcionalidade de venda ainda será implementada")}
          className="bg-green-600 hover:bg-green-700 text-white px-10 py-4 rounded-xl text-xl font-medium transition"
        >
          Venda
        </button>

        <button
          onClick={() => navigate('/revenda')}
          className="bg-blue-600 hover:bg-blue-700 text-white px-10 py-4 rounded-xl text-xl font-medium transition"
        >
          Revenda
        </button>
      </div>
    </main>
  );
}
